import './App.css';
import KeyJson from './keys.json';

const App = () => {

  const [selected, setSelected] = useState("");

  const onSelect = (dict) => {
    if (dict.value !== "") {
      setSelected(dict.value);
    } else {
      KeyJson[dict.key] = selected;
    }
  }

  return (
    <div className="container text-center align-items-center">
      <div className="row m-1">
        {
          KeyJson.map(k => <div className="col-2" key={k.key} onClick={() => onSelect(k)}>{k.value}</div>)
        }
      </div>
    </div>
  );
}

export default App;
